def determine_winner(test_cases):
    gb = [0, 1, 2, 2, 3, 3]
    ga = [0 for x in range(70)]
    gag = [0 for x in range(70)]
    ga[0] = 2
    gag[0] = 0
    for i in range(1, 70):
        if i % 4 == 0:
            ga[i] = 1.5 * ga[i - 1]
            gag[i] = 0
        else:
            ga[i] = 2 * ga[i - 1]
            gag[i] = gag[i - 1] + 1

    def g(n):
        if n < 6:
            return gb[n]
        else:
            x = n // 6
            a = 0
            for (i, k) in enumerate(ga):
                if k <= x:
                    a = i
                else:
                    break
            return gag[a]
    results = []
    for case in test_cases:
        (N, A) = case
        res = g(A[0])
        for i in range(1, N):
            res ^= g(A[i])
        if res == 0:
            results.append('Derek')
        else:
            results.append('Henry')
    return results

